import React, { useState } from "react";
import "./css/nav.css";
import { useNavigate } from "react-router-dom";
function Nav() {
  const navigate = useNavigate();
  const [isOpen, setIsOpen] = useState(false);
  const [dd, setdd] = useState(false);
  const dep = () => {
    navigate("/deposit");
  };
  const wit = () => {
    navigate("/withdraw");
  };
  const p = () => {
    setIsOpen(!isOpen);
  };
  const h = () => {
    navigate("/home");
  };
  const u = () => {
    navigate("/um");
  };
  const r = () => {
    navigate("/result");
  };
  const ndd = () => {
    setdd(true);
  };
  return (
    <div className="nmain">
      <div className="nav">
        <div id="nh1">GAMING HUB</div>
        <div className="ndd">
          <button id="ndd" onClick={ndd}>
            X
          </button>
        </div>
        {dd && (
          <div>
            <div>COIN</div>
            <div>
              <button>HOME</button>
            </div>
            <div>
              <button>UPCOMMING MATCHES</button>
            </div>
            <div>
              <button>RESULT</button>
            </div>
            <div>
              <button>PROFILE</button>
            </div>
            <div>
              <button>DEPOSIT</button>
            </div>
            <div>
              <button>WITHDRAW</button>
            </div>
            <div>
              <button>HELP-LINE</button>
            </div>
          </div>
        )}
        <div className="hur">
          <button onClick={h}>HOME</button>
          <button className="ur" onClick={u}>
            UPCOMMING MATCHES
          </button>
          <button className="ur" onClick={r}>
            RESULT
          </button>
        </div>
        <div className="p">
          <button onClick={p}>PROFILE</button>
        </div>
      </div>
      {isOpen && (
        <div className="dw">
          <button onClick={dep}>DEPOSIT</button>
          <button onClick={wit}>WITHDRAW</button>
          <button>HELP-LINE</button>
        </div>
      )}
    </div>
  );
}
export default Nav;
